values:
3 months and counting... and i hope i can do even better in work, be it CCR, technical skills, PR, domain knowledge etc. On and off i get the feeling that i'm off the hook. However after talking about it with friends/ jack i get a tad bit better and start to get the motivation to work in the current environment. 

The sense of self-worth is really important to me. It gets me going.&nbsp; :&gt;

I want to do more shopping!! You know me, when i was a student i was really broke to buy new clothes. Then when i started working, with cash popping out in the bank account, i tend to splurge on things which i always wanted to buy when i was in the Uni. Then.. i started online shopping, checking out new collections every now and then. Buy things to coax my loved ones is kinda destressing activity for me, then i realised i begin to take extraaa good care of your body and face.

Received my results on the 30th may and well, no more modules and grade stuff, now is about performance and efficiency, how u can help your employer earn money $$. 

Moving on to the next phase of life which i've been like avoiding since sec 4. Choose Jc over diploma cause i don't want to make a decision so soon, as to what to major in. After Jc, i'd to make the greatest decision of my life, which major to take.&nbsp; 

Now i'm in the IT industry, there is no looking back. I know best where i stand, and how much work need to be done for more achievements.&nbsp;&nbsp; 

So, thats it, CAREER!!

Yey! Finally i am done with my papers... Right now i'm hanging around in the lab for Jack's exam to end!! 

So how it felt after finishing my last paper? Well it didn't went smoothly... didn't have a good exam ending because of my Finance paper. I was stupid enough to not know how to do one long part of a question. :&lt; Was abit upset and i think i talked to jack rudely :&lt; Anyway will apologise to him later, meanwhile i will blog about my graduation gown testing!

Went to forum to try out my academic dress.. hehe and the hat! So funny, was fumbling the dresses with Corine and trying to figure out how to wear the hat nicely.. It squashed my hair down and make me look so ugly! Anyone knows how to wear the hat nicely? any tips? 

Initially was wanting to rent the dress, however after corine opinion on that she wants to purchase the dress because she wants take family picture with her brother whose gonna like graduate 6 yrs later?! lol Then i thought of jack and qiu min! Jack is graduating next year as he is doing honors while min gonna take another 3 yrs, so i might as well buy and keep so i can take nice nice studio photos with them! yey!&nbsp; 

Now, is time to move on to another phase of my exciting life. :&gt;
